import React from "react";
import styled from "styled-components";
import { LOGOBGContainer } from "./style";

const LogoContainer = styled.div`
  width: 100%;
`;

function Index() {
  return (
    <>
      <LogoContainer>
        <LOGOBGContainer>this</LOGOBGContainer>
      </LogoContainer>
    </>
  );
}

export default Index;
